package strings;

import org.junit.jupiter.api.Test;

import static org.junit.jupiter.api.Assertions.assertEquals;

/**
 * Created by Ognian Gloushkov on 2019-03-20.
 */
class SherlockAndTheValidStringTest {

    @Test
    void test1() {
        String input = "aabbcd";
        String result = SherlockAndTheValidString.isValid(input);
        assertEquals("NO", result);
    }

    @Test
    void test2() {
        String input = "aabbccddeefghi";
        String result = SherlockAndTheValidString.isValid(input);
        assertEquals("NO", result);
    }

    @Test
    void test3() {
        String input = "abcdefghhgfedecba";
        String result = SherlockAndTheValidString.isValid(input);
        assertEquals("YES", result);
    }

    @Test
    void test4() {
        String input = "aabbc";
        String result = SherlockAndTheValidString.isValid(input);
        assertEquals("YES", result);
    }

    @Test
    void test5() {
        String input = "aaaabbcc";
        String result = SherlockAndTheValidString.isValid(input);
        assertEquals("NO", result);
    }

    @Test
    void test6() {
        String input =
                "";
        String result = SherlockAndTheValidString.isValid(input);
        assertEquals("YES", result);
    }

    @Test
    void test7() {
        String input =
                "".concat(
                "");
        String result = SherlockAndTheValidString.isValid(input);
        assertEquals("YES", result);
    }

}